import React, { useState } from "react";
import axios from "axios";
import './FileUpload.css';

const PreprocessingDashboard = () => {
    const [file, setFile] = useState(null);
    const [processedData, setProcessedData] = useState(null);
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState(null);

    const handleFileChange = (event) => {
        setFile(event.target.files[0]);
    };

    const handleUpload = async () => {
        if (!file) {
            setError("Please select a file first.");
            return;
        }
        
        setLoading(true);
        setError(null);
        const formData = new FormData();
        formData.append("file", file);

        try {
            const response = await axios.post("http://localhost:5000/upload", formData, {
                headers: { "Content-Type": "multipart/form-data" },
            });
            
            setProcessedData(response.data);
        } catch (err) {
            setError(err.response?.data?.error || "An error occurred while processing the file.");
        } finally {
            setLoading(false);
        }
    };

    return (
        <div className="container mx-auto p-6 text-center">
            <h2 className="text-xl font-bold mb-4">Data Preprocessing Dashboard</h2>
            
            <div className="mb-4">
                <input type="file" accept=".csv" onChange={handleFileChange} className="border p-2" />
                <button onClick={handleUpload} disabled={loading} className="ml-2 bg-blue-500 text-white px-4 py-2 rounded">
                    {loading ? "Processing..." : "Upload & Process"}
                </button>
            </div>

            {error && <p className="text-red-500">{error}</p>}

            {processedData && processedData.processed_data && (
                <div className="mt-6">
                    <h3 className="text-lg font-semibold">Processed Data Preview</h3>
                    <ProcessedDataTable data={processedData.processed_data.slice(0, 10)} />

                    <div className="mt-4 flex justify-center gap-4">
                        <a href={processedData.download_link} download>
                            <button className="bg-green-500 text-white px-4 py-2 rounded">Download Processed CSV</button>
                        </a>
                        <a href={processedData.visualization_link} target="_blank" rel="noopener noreferrer">
                            <button className="bg-purple-500 text-white px-4 py-2 rounded">View Histogram</button>
                        </a>
                    </div>
                </div>
            )}
        </div>
    );
};

const ProcessedDataTable = ({ data }) => {
    if (!data || data.length === 0) {
        return <p className="text-gray-500 italic">No processed data available.</p>;
    }

    const columns = Object.keys(data[0]);

    return (
        <div className="overflow-x-auto mt-4">
            <table className="w-full border-collapse border border-gray-300">
                <thead>
                    <tr className="bg-blue-500 text-white">
                        {columns.map((col, index) => (
                            <th key={index} className="p-2 border border-gray-300">{col}</th>
                        ))}
                    </tr>
                </thead>
                <tbody>
                    {data.map((row, rowIndex) => (
                        <tr key={rowIndex} className={rowIndex % 2 === 0 ? "bg-gray-100" : "bg-white"}>
                            {columns.map((col, colIndex) => (
                                <td key={colIndex} className="p-2 border border-gray-300">{row[col]}</td>
                            ))}
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default PreprocessingDashboard;
